  true,\n\t\"url\": null,\n\t\"notes\": \"tResearch on next-generation air traffic
  management systems is being conducted at several laboratories using custom software.
  In order to provide a more uniform research platform for en route air traffic management
  research, NASA has recently developed the FACET software package. While FACET incorporates
  most of the features required for conducting research, it is sometimes necessary
  to extend its capabilities. However, this can demand a significant programming investment.rntThe
  Phase I SBIR project developed the prototype version of scriptable software that
  allows simpler access to FACET functionality. This software is termed CARAT# (Configurable
  Airspace Research and Analysis Tool ? Scriptable). The first version of CARAT# is
  built upon a commercial software platform, while a second version employs a freely
  available, scriptable environment as its foundation. The use of CARAT# was illustrated
  by formulating four research problems during the Phase I research. By making the
  capabilities of FACET accessible to a larger population of researchers, CARAT# can
  help accelerate the pace of air traffic management research. rntThe complete version
  of the CARAT# software will be developed during the Phase II work. Additional research
  problems will also be formulated. The software will be commercialized to the ATM
  research community towards the end of Phase II research.rn\",\n\t\"license_title\":
